import React, { useEffect } from "react";
import { db } from "../utils/config";
import {
  collection,
  getDoc,
  addDoc,
  updateDoc,
  doc,
  onSnapshot,
} from "firebase/firestore";

function SendTestData() {
  useEffect(() => {
    const testDataSend = async () => {
      let data = [];

      console.log(data);

      const testingSendingData = doc(db, "users", "fragsteryt@gmail.com");
      await updateDoc(testingSendingData, { data });
    };
    testDataSend();
  }, []);
  return <div></div>;
}

export default SendTestData;
